        partial void CustomCtor(
            IBinaryReadStream stream,
            int finalPos,
            int offset);

        protected SimpleModelBinaryOverlay(
            ReadOnlyMemorySlice<byte> bytes,
            BinaryOverlayFactoryPackage package)
            : base(
                bytes: bytes,
                package: package)
        {
        }

        public static SimpleModelBinaryOverlay SimpleModelFactory(
            BinaryMemoryReadStream stream,
            BinaryOverlayFactoryPackage package,
            RecordTypeConverter? recordTypeConverter = null)
        {
            var ret = new SimpleModelBinaryOverlay(
                bytes: stream.RemainingMemory,
                package: package);
            int offset = stream.Position;
            ret.CustomCtor(
                stream: stream,
                finalPos: stream.Length,
                offset: 0);
            ret.FillTypelessSubrecordTypes(
                stream: stream,
                finalPos: stream.Length,
                offset: offset,
                recordTypeConverter: recordTypeConverter,
                fill: ret.FillRecordType);
            return ret;
        }

        public virtual TryGet<int?> FillRecordType(
            BinaryMemoryReadStream stream,
            int finalPos,
            int offset,
            RecordType type,
            int? lastParsed,
            RecordTypeConverter? recordTypeConverter)
        {
            type = recordTypeConverter.ConvertToStandard(type);
            switch (type.TypeInt)
            {
                case 0x4C444F4D: // MODL
                {
                    if (lastParsed.HasValue && lastParsed.Value >= (int)SimpleModel_FieldIndex.File) return TryGet<int?>.Failure;
                    _FileLocation = (ushort)(stream.Position - offset);
                    return TryGet<int?>.Succeed((int)SimpleModel_FieldIndex.File);
                }
                case 0x54444F4D: // MODT
                {
                    _DataLocation = (ushort)(stream.Position - offset);
                    return TryGet<int?>.Succeed((int)SimpleModel_FieldIndex.Data);
                }
                default:
                    return TryGet<int?>.Failure;
            }
        }
